// src/App.js
import React from 'react';

// This is the main App component
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to CNCTD!</h1>
        <p>
          This is the main App component.
        </p>
      </header>
    </div>
  );
}

export default App;
